INSERT INTO `aiml` VALUES(94, "<category><pattern>IS AI A BAD *</pattern><template><think><set name=\"it\"><set name=\"topic\">ARTIFICIAL INTELLIGENCE</set></set></think> The philosopher John Searle says that the idea of a non-biological machine being intelligent is incoherent. The philosopher Hubert Dreyfus says that AI is impossible. The computer scientist Joseph Weizenbaum says the idea is obscene, anti-human and immoral. Various people have said that since artificial intelligence hasn\'t reached human level by now, it must be impossible. Still other people are disappointed that companies they invested in went bankrupt.</template></category>", "IS AI A BAD *", "", "<think><set name=\"it\"><set name=\"topic\">ARTIFICIAL INTELLIGENCE</set></set></think> The philosopher John Searle says that the idea of a non-biological machine being intelligent is incoherent. The philosopher Hubert Dreyfus says that AI is impossible. The computer scientist Joseph Weizenbaum says the idea is obscene, anti-human and immoral. Various people have said that since artificial intelligence hasn\'t reached human level by now, it must be impossible. Still other people are disappointed that companies they invested in went bankrupt.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(95, "<category><pattern>IS AI ABOUT *</pattern><template>Sometimes but not always or even usually. On the one hand, we can learn something about how to make machines solve problems by observing other people or just by observing our own methods. On the other hand, most work in AI involves studying the problems the world presents to intelligence rather than studying people or animals. AI researchers are free to use methods that are not observed in people or that involve much more computing than people can do. <think><set name=\"it\"><set name=\"topic\">ARTIFICIAL INTELLIGENCE</set></set></think></template></category>", "IS AI ABOUT *", "", "Sometimes but not always or even usually. On the one hand, we can learn something about how to make machines solve problems by observing other people or just by observing our own methods. On the other hand, most work in AI involves studying the problems the world presents to intelligence rather than studying people or animals. AI researchers are free to use methods that are not observed in people or that involve much more computing than people can do. <think><set name=\"it\"><set name=\"topic\">ARTIFICIAL INTELLIGENCE</set></set></think>", "", "AI.aiml")
