INSERT INTO `aiml` VALUES(119, "<category><pattern>WHAT ABOUT PARALLEL *</pattern><template>Machines with many processors are much faster than single processors can be. Parallelism itself presents no advantages, and parallel machines are somewhat awkward to program. When extreme speed is required, it is necessary to face this awkwardness. <think> <set name=\"it\"> <set name=\"topic\">ARTIFICIAL INTELLIGENCE</set> </set> </think> </template></category>", "WHAT ABOUT PARALLEL *", "", "Machines with many processors are much faster than single processors can be. Parallelism itself presents no advantages, and parallel machines are somewhat awkward to program. When extreme speed is required, it is necessary to face this awkwardness. <think> <set name=\"it\"> <set name=\"topic\">ARTIFICIAL INTELLIGENCE</set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(120, "<category><pattern>WHAT ABOUT _ CHILD MACHINE *</pattern><template>This idea has been proposed many times, starting in the 1940s. Eventually, it will be made to work. However, AI programs haven\'t yet reached the level of being able to learn much of what a child learns from physical experience. Nor do present programs understand language well enough to learn much by reading. <think> <set name=\"it\"> <set name=\"topic\">ARTIFICIAL INTELLIGENCE</set> </set> </think> </template></category>", "WHAT ABOUT _ CHILD MACHINE *", "", "This idea has been proposed many times, starting in the 1940s. Eventually, it will be made to work. However, AI programs haven\'t yet reached the level of being able to learn much of what a child learns from physical experience. Nor do present programs understand language well enough to learn much by reading. <think> <set name=\"it\"> <set name=\"topic\">ARTIFICIAL INTELLIGENCE</set> </set> </think> ", "", "AI.aiml")
