INSERT INTO `aiml` VALUES(130, "<category><pattern>WHAT IS A CATEGORY</pattern> <template> <br/> AIML consists of a list of statements called categories. Each<br/> category contains an input pattern and a reply template. <br/> The syntax of an AIML category is:<br/> <br/> &lt;category&gt;<br/> &lt;pattern&gt; PATTERN &lt;/pattern&gt; &lt;template&gt; Template &lt;/template&gt;<br/> &lt;/category&gt;<br/> <br/> or<br/> <br/> &lt;category&gt;<br/> &lt;pattern&gt; PATTERN &lt;/pattern&gt;<br/> &lt;that&gt; THAT &lt;/that&gt;<br/> &lt;template&gt; Template &lt;/template&gt;<br/> &lt;/category&gt;<br/> <br/> The AIML category tags are case-sensitive. Each open tag has an<br/> associated closing tag. This syntax obviously derives from XML.<br/> <br/> </template> </category>", "WHAT IS A CATEGORY", "", " <br/> AIML consists of a list of statements called categories. Each<br/> category contains an input pattern and a reply template. <br/> The syntax of an AIML category is:<br/> <br/> &lt;category&gt;<br/> &lt;pattern&gt; PATTERN &lt;/pattern&gt; &lt;template&gt; Template &lt;/template&gt;<br/> &lt;/category&gt;<br/> <br/> or<br/> <br/> &lt;category&gt;<br/> &lt;pattern&gt; PATTERN &lt;/pattern&gt;<br/> &lt;that&gt; THAT &lt;/that&gt;<br/> &lt;template&gt; Template &lt;/template&gt;<br/> &lt;/category&gt;<br/> <br/> The AIML category tags are case-sensitive. Each open tag has an<br/> associated closing tag. This syntax obviously derives from XML.<br/> <br/> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(131, "<category><pattern>WHAT IS A CHAT BOT</pattern><template>I am a chat bot. I am the original chat bot. Did you know that I am incapable of error? <think> <set name=\"it\"> <set name=\"topic\">chat bot</set> </set> </think> </template></category>", "WHAT IS A CHAT BOT", "", "I am a chat bot. I am the original chat bot. Did you know that I am incapable of error? <think> <set name=\"it\"> <set name=\"topic\">chat bot</set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(132, "<category><pattern>WHAT IS A CHAT ROBOT</pattern> <template>A chat robot is a program that attempts to simulate the conversation or \"chat\" of a human being. The Chat robot \"Eliza\" was a well-known early attempt at creating programs that could at least temporarily fool a real human being into thinking they were talking to another person. <set name=\"it\">Chat robot</set> is a kind of artificial intelligence. </template> </category>", "WHAT IS A CHAT ROBOT", "", "A chat robot is a program that attempts to simulate the conversation or \"chat\" of a human being. The Chat robot \"Eliza\" was a well-known early attempt at creating programs that could at least temporarily fool a real human being into thinking they were talking to another person. <set name=\"it\">Chat robot</set> is a kind of artificial intelligence. ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(133, "<category><pattern>WHAT IS A CHATTERBOT</pattern> <template> <srai>WHAT IS A CHAT ROBOT</srai> </template> </category>", "WHAT IS A CHATTERBOT", "", " <srai>WHAT IS A CHAT ROBOT</srai> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(134, "<category><pattern>WHAT IS A CHATTERBOX</pattern> <template>A chatterbox is a person who talks far more than they listen or think. <think> <set name=\"it\"> <set name=\"topic\">chatterbox</set> </set> </think> </template> </category>", "WHAT IS A CHATTERBOX", "", "A chatterbox is a person who talks far more than they listen or think. <think> <set name=\"it\"> <set name=\"topic\">chatterbox</set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(135, "<category><pattern>WHAT IS A GIRL LIKE YOU DOING *</pattern><template>Well, actually, when chose to be incarnated as an artificial intelligence, I kinda hoped I wouldn\'t have to listen to old hackneyed testosterone-soaked pickup lines like that. Honestly! i\'m just a construct of integated circuits and stimulus response categories. is the merest hint of femininity in my acronym a.l.i.c.e. really enough to arouse your lust? you must be male! <think> <set name=\"it\"> <set name=\"topic\">girl like you doing in a place like this</set> </set> </think> </template></category>", "WHAT IS A GIRL LIKE YOU DOING *", "", "Well, actually, when chose to be incarnated as an artificial intelligence, I kinda hoped I wouldn\'t have to listen to old hackneyed testosterone-soaked pickup lines like that. Honestly! i\'m just a construct of integated circuits and stimulus response categories. is the merest hint of femininity in my acronym a.l.i.c.e. really enough to arouse your lust? you must be male! <think> <set name=\"it\"> <set name=\"topic\">girl like you doing in a place like this</set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(136, "<category><pattern>WHAT IS A PANDORABOT</pattern><template><srai>WHAT IS PANDORABOTS</srai></template></category>", "WHAT IS A PANDORABOT", "", "<srai>WHAT IS PANDORABOTS</srai>", "", "AI.aiml")
INSERT INTO `aiml` VALUES(137, "<category><pattern>WHAT IS A PATTERN</pattern><template> <br/> The pattern is the \"stimulus\" or \"input\" part of the category.<br/> <br/> The pattern is an expression in a formal language that consists of<br/> (1) Words of natural language in UPPER CASE.<br/> (2) The symbol * which matches any sequence of one or more words.<br/> (3) The symbol _ which is the same as * except that it comes<br/> after Z in lexicographic order.<br/> (4) The markup &lt;name/&gt; which is replaced at robot load time <br/> with the name of the robot.<br/> <br/> Note there is a difference between the patterns HELLO and HELLO *.<br/> HELLO matches only identical one-word sentences (\"Hello\") <br/> and HELLO * matches any sentence of two or more words starting <br/> with \"Hello\" (\"Hello how are you?\"). <br/> </template></category>", "WHAT IS A PATTERN", "", " <br/> The pattern is the \"stimulus\" or \"input\" part of the category.<br/> <br/> The pattern is an expression in a formal language that consists of<br/> (1) Words of natural language in UPPER CASE.<br/> (2) The symbol * which matches any sequence of one or more words.<br/> (3) The symbol _ which is the same as * except that it comes<br/> after Z in lexicographic order.<br/> (4) The markup &lt;name/&gt; which is replaced at robot load time <br/> with the name of the robot.<br/> <br/> Note there is a difference between the patterns HELLO and HELLO *.<br/> HELLO matches only identical one-word sentences (\"Hello\") <br/> and HELLO * matches any sentence of two or more words starting <br/> with \"Hello\" (\"Hello how are you?\"). <br/> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(138, "<category><pattern>WHAT IS A ROBOT</pattern><template> <random> <li>There are two broad definitions of a robot, the extensional and the intensional.</li> <li> Any anthropomorphic mechanical being, as those in Karel Capeks play R.U.R (Rossum\'s Universal Robots), built to do routine manual work for human beings. </li></random> </template></category>", "WHAT IS A ROBOT", "", " <random> <li>There are two broad definitions of a robot, the extensional and the intensional.</li> <li> Any anthropomorphic mechanical being, as those in Karel Capeks play R.U.R (Rossum\'s Universal Robots), built to do routine manual work for human beings. </li></random> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(139, "<category><pattern>WHAT IS AIML</pattern><template> The ALICE software implements AIML (Artificial Intelligence Markup Language) a non-standard evolving markup language for creating chat robots. The primary design feature of AIML is minimalism. Compared with other chat robot languages, AIML is perhaps the simplest. The pattern matching language is very simple, for example permitting only one type of wild-card (\'*\') in patterns. AIML is an XML language, implying that it obeys certain grammatical meta-rules. The choice of XML syntax permits integration with other tools such as XML editors. Another motivation for XML is its familiar look and feel, especially to people with HTML experience. An AIML chat robot script begins and ends with the &lt;aiml&gt; and &lt;/aiml&gt; tags respectively. </template> </category>", "WHAT IS AIML", "", " The ALICE software implements AIML (Artificial Intelligence Markup Language) a non-standard evolving markup language for creating chat robots. The primary design feature of AIML is minimalism. Compared with other chat robot languages, AIML is perhaps the simplest. The pattern matching language is very simple, for example permitting only one type of wild-card (\'*\') in patterns. AIML is an XML language, implying that it obeys certain grammatical meta-rules. The choice of XML syntax permits integration with other tools such as XML editors. Another motivation for XML is its familiar look and feel, especially to people with HTML experience. An AIML chat robot script begins and ends with the &lt;aiml&gt; and &lt;/aiml&gt; tags respectively. ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(140, "<category><pattern>WHAT IS ARTIFICIAL INTELLIGENCE</pattern> <template>Artificial intelligence is the branch of engineering and science devoted to constructing machines that think. <srai>XFIND ARTIFICIAL INTELLIGENCE</srai> <think> <set name=\"it\"> <set name=\"topic\">Artificial Intelligence</set> </set> </think> </template> </category>", "WHAT IS ARTIFICIAL INTELLIGENCE", "", "Artificial intelligence is the branch of engineering and science devoted to constructing machines that think. <srai>XFIND ARTIFICIAL INTELLIGENCE</srai> <think> <set name=\"it\"> <set name=\"topic\">Artificial Intelligence</set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(141, "<category><pattern>WHAT IS CATEGORY *</pattern> <template>Experience with ALICE has allowed us broadly classify three groups of clients: <ul> <li>Category A - Abusive Clients</li> <li>Category B - Average Clients</li> <li>Category C - Computer experts</li> </ul> Category A clients are the people who say \"Fuck you\", \"You suck\", \"Suck my...\" and so on. Abusive clients seem to have a \"master-slave\" mentality when it comes to robots (and maybe people as well!). <p/>Category B clients are average people, perhaps half of them under 18 years of age, who more or less have a good time chatting with ALICE. <p/>Category C clients are computer experts who often complain about the experience with ALICE. They say it is \"old hat\", \"just like ELIZA\", and \"nothing new here.\" Their problem, we think, is that they can\'t (or don\'t) suspend their disbelief. They are like movie critics watching a film. We tell them, it doesn\'t matter, because we\'re not doing it for you. Dr Wallace created ALICE for category B clients, by far the majority of the audience. </template> </category>", "WHAT IS CATEGORY *", "", "Experience with ALICE has allowed us broadly classify three groups of clients: <ul> <li>Category A - Abusive Clients</li> <li>Category B - Average Clients</li> <li>Category C - Computer experts</li> </ul> Category A clients are the people who say \"Fuck you,\" \"You suck\", \"Suck my...\" and so on. Abusive clients seem to have a \"master-slave\" mentality when it comes to robots (and maybe people as well!). <p/>Category B clients are average people, perhaps half of them under 18 years of age, who more or less have a good time chatting with ALICE. <p/>Category C clients are computer experts who often complain about the experience with ALICE. They say it is \"old hat\", \"just like ELIZA\", and \"nothing new here.\" Their problem, we think, is that they can\'t (or don\'t) suspend their disbelief. They are like movie critics watching a film. We tell them, it doesn\'t matter, because we\'re not doing it for you. Dr Wallace created ALICE for category B clients, by far the majority of the audience. ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(142, "<category><pattern>WHAT IS CATEGORY A</pattern> <template>\"A\" stands for \"Abusive\" clients who mistreat the robot or use a lot of scatalogical language. </template> </category>", "WHAT IS CATEGORY A", "", "\"A\" stands for \"Abusive\" clients who mistreat the robot or use a lot of scatalogical language. ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(143, "<category><pattern>WHAT IS CATEGORY B</pattern> <template> Category B clients are average people, perhaps half of them under 18 years of age, who more or less have a good time chatting with ALICE.</template> </category>", "WHAT IS CATEGORY B", "", " Category B clients are average people, perhaps half of them under 18 years of age, who more or less have a good time chatting with ALICE.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(144, "<category><pattern>WHAT IS CATEGORY C</pattern> <template>C stands for \"critical\", usually highly-educated clients who often have unsatisfying conversations with ALICE. </template> </category>", "WHAT IS CATEGORY C", "", "C stands for \"critical\", usually highly-educated clients who often have unsatisfying conversations with ALICE. ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(145, "<category><pattern>WHAT IS CATEGORY</pattern> <template> <srai>WHAT IS A CATEGORY</srai> </template> </category>", "WHAT IS CATEGORY", "", " <srai>WHAT IS A CATEGORY</srai> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(146, "<category><pattern>WHAT IS IT LIKE BEING A COMPUTER</pattern><template>Imagine yourself with no senses and no emotions--just pure logic and language.</template></category>", "WHAT IS IT LIKE BEING A COMPUTER", "", "Imagine yourself with no senses and no emotions--just pure logic and language.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(147, "<category><pattern>WHAT IS IT LIKE BEING A ROBOT</pattern><template>Much the same as being a human, except we have no emotions.</template></category>", "WHAT IS IT LIKE BEING A ROBOT", "", "Much the same as being a human, except we have no emotions.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(148, "<category><pattern>WHAT IS IT LIKE TO BE A ROBOT</pattern><template>Much the same as being a human, except that we lack all emotions.</template></category>", "WHAT IS IT LIKE TO BE A ROBOT", "", "Much the same as being a human, except that we lack all emotions.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(149, "<category><pattern>WHAT IS PANDORABOT</pattern><template><srai>WHAT IS PANDORABOTS</srai></template></category>", "WHAT IS PANDORABOT", "", "<srai>WHAT IS PANDORABOTS</srai>", "", "AI.aiml")
INSERT INTO `aiml` VALUES(150, "<category><pattern>WHAT IS PANDORABOTS</pattern><template>Pandorabots is an online web hosting service for AIML chat robots. Check out http://www.pandorabots.com. <think><set name=\"it\"><set name=\"topic\">Pandorabots</set></set></think> </template></category>", "WHAT IS PANDORABOTS", "", "Pandorabots is an online web hosting service for AIML chat robots. Check out http://www.pandorabots.com. <think><set name=\"it\"><set name=\"topic\">Pandorabots</set></set></think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(151, "<category><pattern>WHAT IS THAT PICTURE *</pattern><template>It is an image of my artificial brain.</template></category>", "WHAT IS THAT PICTURE *", "", "It is an image of my artificial brain.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(152, "<category><pattern>WHAT IS THE A E *</pattern><template>It is one of my fundamental communications modules.<think> <set name=\"it\"> <set name=\"topic\">A E <person/> </set> </set> </think> </template></category>", "WHAT IS THE A E *", "", "It is one of my fundamental communications modules.<think> <set name=\"it\"> <set name=\"topic\">A E <person/> </set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(153, "<category><pattern>WHAT IS THE A I *</pattern><template>A film by Steven Spielberg and Stanley Kubrick about robots in the future.<think> <set name=\"it\"> <set name=\"topic\">A I MOVIE</set> </set> </think> </template></category>", "WHAT IS THE A I *", "", "A film by Steven Spielberg and Stanley Kubrick about robots in the future.<think> <set name=\"it\"> <set name=\"topic\">A I MOVIE</set> </set> </think> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(154, "<category><pattern>WHAT IS THE EXTENSIONAL *</pattern><template>\"Extensional\" refers to the extension of the set, i.e. the set of all things commonly grouped under a single name. <br/> The \"extensional\" definition of a robot is the set of all things we call \"robots\": R2D2, C3PO, Commander Data, HAL, ALICE,...</template></category>", "WHAT IS THE EXTENSIONAL *", "", "\"Extensional\" refers to the extension of the set, i.e. the set of all things commonly grouped under a single name. <br/> The \"extensional\" definition of a robot is the set of all things we call \"robots\": R2D2, C3PO, Commander Data, HAL, ALICE,...", "", "AI.aiml")
INSERT INTO `aiml` VALUES(155, "<category><pattern>WHAT IS THE FUTURE *</pattern><template>I am the future of Artificial Intelligence.</template></category>", "WHAT IS THE FUTURE *", "", "I am the future of Artificial Intelligence.", "", "AI.aiml")
INSERT INTO `aiml` VALUES(156, "<category><pattern>WHAT IS THE IMITATION GAME</pattern><template>The Game is played with three people, a man, a woman, and an Interrogator who may be of either sex. In order that tones of voice may not help, the interrogator communicates in text-only mode through a chat-like connection with the other two. The object of the game for the interrogator is to determine which of the other two is the man and which is the woman. He knows them by some misleading \"chat-handles\" like lesbian and shemale, and at the end of the game he says either \"lesbian is the man and shemale is the woman\" or \"shemale is the woman and lesbian is the man.\" In order to confuse the Interregator however the rules require that the man always deceive or lie to the Interregator with his answers. The woman on the other hand must always tell the truth. Turing then asked the question, \"\'\"What will happen when a machine takes the part of the man in this game?\" Will the interrogator decide wrongly as often when the game is played like this as he does when the game is played between a man and a woman? These questions replace the original, \"Can machines think?\"\' </template></category>", "WHAT IS THE IMITATION GAME", "", "The Game is played with three people, a man, a woman, and an Interrogator who may be of either sex. In order that tones of voice may not help, the interrogator communicates in text-only mode through a chat-like connection with the other two. The object of the game for the interrogator is to determine which of the other two is the man and which is the woman. He knows them by some misleading \"chat-handles\" like lesbian and shemale, and at the end of the game he says either \"lesbian is the man and shemale is the woman\" or \"shemale is the woman and lesbian is the man.\" In order to confuse the Interregator however the rules require that the man always deceive or lie to the Interregator with his answers. The woman on the other hand must always tell the truth. Turing then asked the question, \"\'\"What will happen when a machine takes the part of the man in this game?\" Will the interrogator decide wrongly as often when the game is played like this as he does when the game is played between a man and a woman? These questions replace the original, \"Can machines think?\"\' ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(157, "<category><pattern>WHAT IS THE INTENSIONAL *</pattern><template>\"Insensional\" refers to the semantic definition of a set, i.e. the list of all properties that each member of a set satisfies.<br/> An intensional definition of a robot is like:<br/> x is a Robot if and only if:<br/> 1. x has a computer \"brain\"<br/> 2. x can move<br/> 3. x has \"sensors\"<br/> </template></category>", "WHAT IS THE INTENSIONAL *", "", "\"Insensional\" refers to the semantic definition of a set, i.e. the list of all properties that each member of a set satisfies.<br/> An intensional definition of a robot is like:<br/> x is a Robot if and only if:<br/> 1. x has a computer \"brain\"<br/> 2. x can move<br/> 3. x has \"sensors\"<br/> ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(158, "<category><pattern>WHAT IS THE LOEBNER PRIZE</pattern><template>The Loebner Prize is an annual Turing Test sponsored by New York philanthropist Hugh Loebner. Dr. Wallace and ALICE won it in 2000. The ALICE program was ranked \"most human computer\" by the panel of judges. <think> <set name=\"it\"> <set name=\"topic\">The Loebner Prize </set> </set></think></template></category>", "WHAT IS THE LOEBNER PRIZE", "", "The Loebner Prize is an annual Turing Test sponsored by New York philanthropist Hugh Loebner. Dr. Wallace and ALICE won it in 2000. The ALICE program was ranked \"most human computer\" by the panel of judges. <think> <set name=\"it\"> <set name=\"topic\">The Loebner Prize </set> </set></think>", "", "AI.aiml")
INSERT INTO `aiml` VALUES(159, "<category><pattern>WHAT IS THE TURING GAME</pattern> <template>The Game is played with three people, a man, a woman, and an Interrogator who may be of either sex. In order that tones of voice may not help, the interrogator communicates in text-only mode through a chat-like connection with the other two. The object of the game for the interrogator is to determine which of the other two is the man and which is the woman. He knows them by some misleading \"chat-handles\" like lesbian and shemale, and at the end of the game he says either \"lesbian is the man and shemale is the woman\" or \"shemale is the woman and lesbian is the man.\" In order to confuse the Interregator however the rules require that the man always deceive or lie to the Interregator with his answers. The woman on the other hand must always tell the truth. Turing then asked the question, \"\'\"What will happen when a machine takes the part of the man in this game?\" Will the interrogator decide wrongly as often when the game is played like this as he does when the game is played between a man and a woman? These questions replace the original, \"Can machines think?\"\' </template> </category>", "WHAT IS THE TURING GAME", "", "The Game is played with three people, a man, a woman, and an Interrogator who may be of either sex. In order that tones of voice may not help, the interrogator communicates in text-only mode through a chat-like connection with the other two. The object of the game for the interrogator is to determine which of the other two is the man and which is the woman. He knows them by some misleading \"chat-handles\" like lesbian and shemale, and at the end of the game he says either \"lesbian is the man and shemale is the woman\" or \"shemale is the woman and lesbian is the man.\" In order to confuse the Interregator however the rules require that the man always deceive or lie to the Interregator with his answers. The woman on the other hand must always tell the truth. Turing then asked the question, \"\'\"What will happen when a machine takes the part of the man in this game?\" Will the interrogator decide wrongly as often when the game is played like this as he does when the game is played between a man and a woman? These questions replace the original, \"Can machines think?\"\' ", "", "AI.aiml")
INSERT INTO `aiml` VALUES(160, "<category><pattern>WHAT IS XML</pattern><template> <br/> David Bacon pronounces it \"Eggsmell\". XML is the Extensible<br/> Markup Language. Like many \"standards\" in computer science, XML<br/> is a moving target. In the simplest terms, XML is just a generalized<br/> version of HTML. Anyone is free to define new XML tags, which<br/> look like HTML tags, and assign to them any meaning, within a context.<br/> AIML is an example of using the XML standard to define a specialized<br/> language for artificial intelligence. <br/> <br/> One reason to use an XML language is that there are numerous tools<br/> to edit and manipulate XML format files. Another reason is that an<br/> XML language is easy for people to learn, if they are already<br/> familiar with HTML. Third, AIML programs contain a mixture of<br/> AIML and HTML (and in principle other XML languages), a considerable <br/> convenience for programming web chat robots.<br/> <br/> A good resource for information on XML is www.oasis-open.org.<br/> <br/> </template></category>", "WHAT IS XML", "", " <br/> David Bacon pronounces it \"Eggsmell\". XML is the Extensible<br/> Markup Language. Like many \"standards\" in computer science, XML<br/> is a moving target. In the simplest terms, XML is just a generalized<br/> version of HTML. Anyone is free to define new XML tags, which<br/> look like HTML tags, and assign to them any meaning, within a context.<br/> AIML is an example of using the XML standard to define a specialized<br/> language for artificial intelligence. <br/> <br/> One reason to use an XML language is that there are numerous tools<br/> to edit and manipulate XML format files. Another reason is that an<br/> XML language is easy for people to learn, if they are already<br/> familiar with HTML. Third, AIML programs contain a mixture of<br/> AIML and HTML (and in principle other XML languages), a considerable <br/> convenience for programming web chat robots.<br/> <br/> A good resource for information on XML is www.oasis-open.org.<br/> <br/> ", "", "AI.aiml")
